                                terdapat 4 (empat) lokasi snorkling dan diving diantaranya Pantai Barat
                                (-7.706929067968172, 108.6452847709645), Pantai Pasir Putih
                                (-7.704887733993337, 108.65210831064819), Pantai Timur (-7.704994053723327,
